(47, NULL, 'Death At Fallow End', 'Virginia Weatherby thought she had left her past behind, but the invitation from Crispin Forsythe drags her back to Fallow End, a place where memories are buried, and the air is thick with unresolved passion. As the Earl is murdered in a cruel act of betrayal, Virginia is forced to confront long-buried secrets and lost love.', '<h1><strong style=\"color: rgb(0, 0, 0); background-color: rgb(255, 255, 255);\">Why do we use it?</strong></h1><p><br></p><p><span style=\"color: rgb(0, 0, 0); background-color: rgb(255, 255, 255);\">It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</span></p><p><br></p><h1><strong style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">Where can I get some? Where can I get some? Where can I get some?</strong></h1><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don\'t look even slightly believable. If you are going to use a passage of Lorem Ipsum, you need to be sure there isn\'t anything embarrassing hidden in the middle of text. All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary, making this the first true generator on the Internet. It uses a dictionary of over 200 Latin words, combined with a handful of model sentence structures, to generate Lorem Ipsum which looks reasonable. The generated Lorem Ipsum is therefore always free from repetition, injected humour, or non-characteristic words etc.</span></p><p class=\"ql-align-justify\"><br></p>', 'Anne Rice', 'Mystery', 1, 'cover_images/96Ke4IvOwDpUZdUnAaYv2rP8vEVWc3cbZarN1dtr.png', 3, 0, 0, NULL, 'pending', '2025-05-16 13:56:20', '2025-08-22 12:45:09', 0, NULL),
(53, NULL, 'Death At Fallow End - Continued by Character', 'A continuation of \"Death At Fallow End\" by admin', '<p><strong>Death At Fallow End</strong> - Continued from Lead\'s perspective</p>\n          <p><em>Virginia Weatherby thought she had left her past behind, but the invitation from Crispin Forsythe drags her back to Fallow End, a place where memories are buried, and the air is thick with unresolved ...</em></p>\n          <hr>\n          <p>As Lead, I...</p>', 'admin', 'Horror', 1, NULL, 0, 0, 0, NULL, 'approved', '2025-05-16 18:30:22', '2025-08-05 16:17:32', 1, NULL),
(54, NULL, 'Death At Fallow End - Continued by Character', 'A continuation of \"Death At Fallow End\" by admin', '<p><strong>Death At Fallow End</strong> - Continued from villian\'s perspective</p><p><em>Virginia Weatherby thought she had left her past behind, but the invitation from Crispin Forsythe drags her back to Fallow End, a place where memories are buried, and the air is thick with unresolved ...</em></p><p><br></p><p>As villian, I...</p>', 'admin', 'Mystery', 1, NULL, 0, 0, 0, NULL, 'approved', '2025-05-16 18:35:08', '2025-06-09 13:21:06', 1, NULL),
