(59, NULL, 'Death At Fallow End - Continued by Character', 'A continuation of \"Death At Fallow End\" by newuser', '<p><strong>Death At Fallow End</strong> - Continued from Hero\'s perspective</p>\n testing story<p><em>Virginia Weatherby thought she had left her past behind, but the invitation from Crispin Forsythe drags her back to Fallow End, a place where memories are buried, and the air is thick with unresolved ...</em></p>\n          <hr>\n          <p>As Hero, I...</p>', 'newuser', 'Thriller', 1, NULL, 1, 0, 0, NULL, 'approved', '2025-06-09 15:28:37', '2025-08-21 20:34:15', 1, NULL),
